const fetch = require('node-fetch');

module.exports = async function (context, req) {
    context.log('JavaScript HTTP trigger function processed a request.');

    const payload = {
        Files: [
            {
                fileName: 'fileUploadTests.jpg',
                fileContent: {
                    content: '',
                },
                caseReference: '67890',
                serviceName: 'Testing',
            },
        ],
    };

    const url = 'https://prod-53.westeurope.logic.azure.com:443/workflows/95a71f5b59d94a93bd3edd21eaf19364/triggers/manual/paths/invoke?api-version=2016-06-01&sp=%2Ftriggers%2Fmanual%2Frun&sv=1.0&sig=w_n1tWAz8b9ovEjYN32ZYDQJ1H-9K4ARKcqsrKeVFuc';

    const response = await fetch(url, {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify(payload),
    });

    if (response.ok) {
        const result = await response.json();
        context.log('POST request successful:', result);
        context.res = {
            body: 'POST request successful',
        };
    } else {
        context.log('POST request failed with status:', response.status);
        context.res = {
            status: response.status,
            body: 'POST request failed',
        };
    }
};
